column8:
耐熱・耐久・撥水性を兼ね備えた、硬質皮膜の樹脂用コーティング剤です。<br />
従来のつや出し剤と違い、主成分であるケイ素化合物が、あらゆる未塗装の樹脂表面にガラス状の硬質皮膜を形成し、色あせた樹脂も新品同様に甦らせます。<br /><br />
